sys_variable_value.value:
(function execute(inputs, outputs) {
 if(inputs.maintable)
  var fielddetails =  new GlideRecord('x_1107692_banking_ticket');
  else
   var fielddetails =  new GlideRecord('x_1107692_banking_accountant');
 fielddetails.get(inputs.sysid);
 if(inputs.fieldnameforVerification)
 fielddetails.setValue(inputs.fieldnameforVerification, inputs.fieldvalueforVerification);
 if(inputs.fieldnameforApproval)
 fielddetails.setValue(inputs.fieldnameforApproval, inputs.fieldvalueforApproval);
 fielddetails.update();
 if(inputs.issuperuser){
                    var taskCr = new GlideRecord('sc_task');
                taskCr.initialize();
                taskCr.assigned_to = gs.getUserID();
                taskCr.short_description = inputs.catatlogtaskdesc;
                taskCr.state = '3';
                taskCr.correlation_id = inputs.sysid;
                taskCr.insert();
 }

})(inputs, outputs);

